import jsPDF from "jspdf"
import autoTable from 'jspdf-autotable';


export function generateWeeklyReportPDF(data: any, lieuSelectionne: string | null) {
  const doc = new jsPDF()
  const base64Logo = 'data:image/png;base64,'
  const width = doc.internal.pageSize.getWidth()
  doc.addImage(base64Logo, 'PNG', 5, 10, 55, 50)

  const yOffset = 55

  doc.setFontSize(8)
  doc.setFont("helvetica", "normal")
  doc.text(`${data.periode}`, 35, yOffset - 1, { align: "center" })

  let headColumns: string[] = [];
  let bodyRows: any[] = [];

  if (lieuSelectionne === "Port") {
    headColumns = ["Matricule", "Nom et Prénom", "Diagnostic", "Traitement", "Observation"];
    bodyRows = data.details.map((detail: any) => [
      detail.employeMatricule,
      detail.employeNom,
      detail.diagnostic || "N/A",
      detail.traitement || "N/A",
      detail.observation || "N/A",
    ]);
  } else if (lieuSelectionne === "Cabinet") {
    headColumns = ["Matricule", "Nom et Prénom", "Motif Médical", "Certificat à compter du", "Jours"];
    bodyRows = data.details.map((detail: any) => [
      detail.employeMatricule,
      detail.employeNom,
      detail.repos?.accorde ? detail.repos.motif : "N/A",
      detail.repos?.accorde ? new Date(detail.repos.dateDebut).toLocaleDateString("fr-FR") : "N/A",
      detail.repos?.accorde ? `${detail.repos.duree} jour(s)` : "NON",
    ]);
  } else {
    headColumns = [
      "Matricule", "Nom et Prénom", "Motif Médical", "Certificat à compter du", "Jours",
      "Diagnostic", "Traitement", "Observation"
    ];
    bodyRows = data.details.map((detail: any) => [
      detail.employeMatricule,
      detail.employeNom,
      detail.repos?.accorde ? detail.repos.motif : "N/A",
      detail.repos?.accorde ? new Date(detail.repos.dateDebut).toLocaleDateString("fr-FR") : "N/A",
      detail.repos?.accorde ? `${detail.repos.duree} jour(s)` : "NON",
      detail.diagnostic || "N/A",
      detail.traitement || "N/A",
      detail.observation || "N/A",
    ]);
  }

  autoTable(doc, {
    startY: yOffset,
    margin: { left: 3, right: 3 },
    styles: {
      font: "helvetica",
      fontSize: 10,
      textColor: [0, 0, 0],
      lineColor: [0, 0, 0],
      lineWidth: 0.2,
      halign: "center",
      valign: "middle",
    },
    headStyles: {
      fillColor: [255, 255, 255],
      textColor: [0, 0, 0],
      fontStyle: 'bold',
    },
    head: [
      [{ content: `Situation hebdomadaire`, colSpan: headColumns.length, styles: { halign: 'center', fontStyle: 'bold', fontSize: 11 } }],
      headColumns
    ],
    body: bodyRows
  });


  doc.save(`rapport_${data.periode.replace(/\//g, "-")}.pdf`)
}

export function generateMonthlyInvoicePDF(data: any) {
  const base64Logo = 'data:image/png;base64,'
  const base64Signature = 'data:image/png;base64,'
  const doc = new jsPDF()

  const width = doc.internal.pageSize.getWidth()
  let y = 20

  const yHeader = 20

  doc.addImage(base64Logo, "PNG", width - 36 - 15, yHeader + 4, 36, 39)

  doc.setFont("helvetica", "bold")
  doc.setFontSize(46)
  doc.setTextColor(83, 130, 53)
  doc.text("Facture", 4.5, yHeader + 19)

  y += 32.6

  doc.setTextColor(77, 77, 77)
  doc.setFontSize(10)

  doc.setFont("Helvetica", "bold")
  doc.text("Prestataires", 2.5, y)
  doc.setFont("Helvetica", "bold")
  doc.text("Cabinet Médical Vouadi", 33, y)
  doc.setFont("Helvetica", "normal")
  doc.setFont("Helvetica", "italic")
  doc.text("Route centre émetteur à côté des maisons Tata", 33, y + 4.5)
  doc.text("Nouakchott, Mauritanie", 33, y + 9)
  doc.text("Tél : 44700138 / 20901877", 33, y + 13.5)

  y += 23

  doc.setFont("Helvetica", "bold")
  doc.text("Client", 2.5, y)
  doc.setFont("Helvetica", "bold")
  doc.text("Terminal à conteneurs de Nouakchott (TCN)", 33, y)
  doc.setFont("Helvetica", "normal")
  doc.setFont("Helvetica", "italic")
  doc.text("Port Autonome de Nouakchott", 33, y + 4.5)
  doc.text("BP 7303", 33, y + 9)

  y += 30

  doc.setFont("Helvetica", "bold")
  doc.setTextColor(0)
  doc.text(`Numéro de la facture`, 2, y)
  doc.text(`Date`, 70, y)
  doc.setFont("Helvetica", "normal")
  doc.text(`${data.numero}`, 2, y + 5)
  doc.text(`${data.currentDate}`, 70, y + 5)

  y += 20

  autoTable(doc, {
    startY: y,
    head: [["Description", "Date", "Prix", "Total"]],
    body: [["Honoraires Médecins Traitant", `${data.periode}`, `${data.honoraires}`, `${data.honoraires}`],
    ["Médicaments", "", `${data.medicaments}`, `${data.medicaments}`], [], [], []],
    styles: {
      font: "Helvetica",
      fontSize: 10,
      cellPadding: 3,
      halign: "center",
      valign: "middle",
      overflow: "linebreak",
    },
    headStyles: {
      fillColor: [83, 130, 53],
      textColor: [255, 255, 255],
      fontStyle: "bold",
    },
    bodyStyles: {
      fillColor: [255, 255, 255],
      textColor: [77, 77, 77],
      lineColor: [200, 200, 200],
      lineWidth: 0.6,
    },
    columnStyles: {
      0: { fontStyle: "bold", halign: "left" },
      3: { halign: "right" },
    },
    margin: { top: y + 10, left: 2, right: 2 },
    theme: "grid",
    didParseCell: function (data) {
      if (data.cell) {
        data.cell.styles.lineWidth = { top: 0, right: 0, bottom: 0.6, left: 0 };
      }
    }
  })

  const finalY = (doc as any).lastAutoTable.finalY + 10;

  doc.setFont("Helvetica", "bold");
  doc.setFontSize(12);
  doc.setTextColor(46, 83, 149);
  doc.text("Total", width - 52, finalY + 20);
  doc.setFont("Helvetica", "bold");
  doc.text(`${data.total}`, width - 4, finalY + 20, { align: "right" });

  const footerY = doc.internal.pageSize.getHeight() - 60;
  doc.setDrawColor(190, 190, 190);
  doc.setLineWidth(0.9);
  doc.line(33, footerY, width - 2, footerY);

  doc.setFontSize(10);
  doc.setTextColor(77, 77, 77);
  doc.setFont("Helvetica", "bold");
  doc.text("Cabinet Médical Vouadi", 2.5, footerY + 4);
  doc.setFont("Helvetica", "normal");
  doc.setFont("Helvetica", "italic");
  doc.text("Route centre émetteur à côté des maisons Tata", 2.5, footerY + 10);
  doc.text("Nouakchott, Mauritanie", 2.5, footerY + 15);
  doc.text("Email : hbounamokhtar@gmail.com", 2.5, footerY + 20);
  doc.text("Tél : 44700138 / 20901877", 2.5, footerY + 25);
  doc.setFont("Helvetica", "bolditalic");
  doc.text("NIF : 00821892", 2.5, footerY + 30);

  doc.addImage(base64Signature, "PNG", width - 57 - 2.5, footerY - 10.5, 57, 52)

  const bottomFooterY = doc.internal.pageSize.getHeight() - 20;
  doc.setDrawColor(46, 83, 149);
  doc.setLineWidth(5);
  doc.line(2, bottomFooterY, width - 2, bottomFooterY);


  doc.save(`Facture TCN ${data.numero}.pdf`)
}